    import App from '../App.js'




    const LoginForm = ({handleLogin, username, password}) => {


      const handleLoginChange = ({ target }) => App.setUsername(target.value)
      const handlePasswordChange = ({ target }) => App.setPassword(target.value)




        return (
        <form onSubmit={handleLogin}>
          <div>
            username
              <input
              type="text"
              value={username}
              name="Username"
              onChange={handleLoginChange}
            />
          </div>
          <div>
            password
              <input
              type="password"
              value={password}
              name="Password"
              onChange={handlePasswordChange}
            />
          </div>
          <button type="submit">login</button>
        </form>      
      )

}



  export default LoginForm
